import React from 'react';
import { ChakraProvider, Box, Container, Tab, TabList, TabPanel, TabPanels, Tabs } from '@chakra-ui/react';
import TicketForm from './components/TicketForm';
import TicketDashboard from './components/TicketDashboard';

function App() {
  return (
    <ChakraProvider>
      <Container maxW="container.xl" py={8}>
        <Box bg="white" borderRadius="lg" boxShadow="md" p={4}>
          <Tabs>
            <TabList>
              <Tab>Create Ticket</Tab>
              <Tab>View Tickets</Tab>
            </TabList>
            <TabPanels>
              <TabPanel>
                <TicketForm />
              </TabPanel>
              <TabPanel>
                <TicketDashboard />
              </TabPanel>
            </TabPanels>
          </Tabs>
        </Box>
      </Container>
    </ChakraProvider>
  );
}

export default App;
